package me.secosme.tika;

import java.io.ByteArrayInputStream;
import java.io.IOException;
import java.io.InputStream;
import java.util.Base64;
import org.apache.tika.exception.TikaException;
import org.apache.tika.metadata.Metadata;
import org.apache.tika.parser.AutoDetectParser;
import org.apache.tika.sax.BodyContentHandler;
import org.xml.sax.SAXException;

public class Main {

    public static void main(String... args) {

        final String jpeg = "";
        final String png = "";

        AutoDetectParser parser = new AutoDetectParser();
        BodyContentHandler handler = new BodyContentHandler();
        Metadata metadata = new Metadata();

        // JPEG

        try (InputStream stream = new ByteArrayInputStream(Base64.getDecoder().decode(jpeg))) {

            parser.parse(stream, handler, metadata);

            for (String name : metadata.names()) {
                System.out.println(String.format("%s : %s", name, metadata.get(name)));
            }

        } catch (IOException | TikaException | SAXException e) {
            /* NOP */}

        // PNG

        metadata = new Metadata();

        try (InputStream stream = new ByteArrayInputStream(Base64.getDecoder().decode(png))) {

            parser.parse(stream, handler, metadata);

            for (String name : metadata.names()) {
                System.out.println(String.format("%s : %s", name, metadata.get(name)));
            }

        } catch (IOException | TikaException | SAXException e) {
            /* NOP */}

    }
}
